protocol ListOfCitiesProtocol {
    var listOfCities: [City] { get set }
}

final class City {
    var name: String
    var lat: Double
    var lon: Double
    var favorite: Bool
    
    init(name: String, lat: Double, lon: Double, favorite: Bool) {
        self.name = name
        self.lat = lat
        self.lon = lon
        self.favorite = favorite
    }
}

